\9\9\9\9result2 = addItem(c)\
\9\9\9end\
\9\9end\
\9end\
\9if result1 ~= result2 then\
\9\9local final = 0\
\9\9for _,v in pairs(valid) do\
\9\9\9if result1 == v or result2 == v then\
\9\9\9\9final = final + 1\
